import React from "react";
import { Routes, Route } from "react-router-dom";
import { occupationRoutes } from "./routes/OccupationRoutes";
import { industriesRoutes } from "./routes/IndustriesRoutes";
import { themesRoutes } from "./routes/ThemesRoutes";
import { eventRoutes } from "./routes/EventRoutes";
// ... other imports

function App() {
  return (
    <Routes>
      {/* ... other routes */}
      <Route path="/occupations/*" element={<OccupationsPage />}>
        {occupationRoutes.map((route) => (
          <Route key={route.path} path={route.path} element={route.children} />
        ))}
      </Route>
      <Route path="/industries/*" element={<IndustriesPage />}>
        {industriesRoutes.map((route) => (
          <Route key={route.path} path={route.path} element={route.children} />
        ))}
      </Route>
      <Route path="/themes/*" element={<ThemePage />}>
        {themesRoutes.map((route) => (
          <Route key={route.path} path={route.path} element={route.children} />
        ))}
      </Route>
      <Route path="/event/*" element={<EventPage />}>
        {eventRoutes.map((route) => (
          <Route key={route.path} path={route.path} element={route.children} />
        ))}
      </Route>
    </Routes>
  );
}

export default App;
